import React from "react"
import { useNavigate } from "react-router-dom"


const Home = ({ user }) => {
  const navigate = useNavigate()
  return user ? (
    <div className="App">
      크레딧 관리 페이지에 오신 것을 환영합니다. 
      <box>
      <button className="button1" onClick={() => navigate("/credit")} >크레딧 구매</button>
      <button className="button2" onClick={() => navigate("/services")}>상품 구매</button>
      </box>
    </div>
  ) : (
    <button className="button1" onClick={() => navigate("/login")}>로그인</button>
  )
}

export default Home
